import React from "react";
import { Nav } from "react-bootstrap";
import { SidebarMenu, SidebarMenuBody } from "react-bootstrap-sidebar-menu";
import "./index.css";
const Bar = (props) => {
  return (
    <>
      <SidebarMenu.Header>
        <SidebarMenu.Brand>{/* Your brand icon */}</SidebarMenu.Brand>
        <SidebarMenu.Toggle />
      </SidebarMenu.Header>
      <SidebarMenuBody></SidebarMenuBody>
    </>
  );
};
// const Sidebar = withRouter(Side);

export default Bar;
